script: |
  super -f text -I q1230.spq | sort > q1230.out

inputs:
  - name: q1230.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 * col2 * - + col2 NOT BETWEEN - ( + 99 ) AND col1 * - 37 * - + 26;
  - name: tab2

outputs:
  - name: q1230.out
    data: |
      46	51	23
      64	77	40
      75	67	58
